        // Brute force
        static int RepeatedNumberNby3Times(List<int> A)
        {
            var t1 = DateTime.Now;
            var coll = new Dictionary<int, int>();
            for (int i = 0; i < A.Count; i++)
            {
                if (!coll.ContainsKey(A[i]))
                {
                    coll.Add(A[i], A.FindAll(x => x == A[i]).Count);
                }
            }

            int ans = -1;
            int maxCount = 0;
            foreach (var item in coll)
            {
                if (maxCount < item.Value)
                {
                    maxCount = item.Value;
                    if (maxCount > A.Count / 3)
                        ans = item.Key;

                }
            }

            Console.WriteLine(DateTime.Now - t1);
            Console.WriteLine(A.Count);
            return ans;
        }

        //  TC = O(N)
        //  SC = O(1)
        static int RepeatedNumberNby3TimesV1(List<int> A)
        {
            if (A.Count <= 2) return A[0];

            int majEle1 = A[0];
            int majEle1Count = 1;
            int majEle2 = 0;
            int majEle2Count = 0;

            for (int i = 1; i < A.Count; i++)
            {
                if (majEle1 == A[i])
                    majEle1Count++;
                else if (majEle2 == A[i])
                    majEle2Count++;
                else if (majEle1Count == 0)
                {
                    majEle1 = A[i];
                    majEle1Count++;
                }
                else if (majEle2Count == 0)
                {
                    majEle2 = A[i];
                    majEle2Count++;
                }
                else
                {
                    majEle1Count--;
                    majEle2Count--;
                }
            }

            int freq1 = 0, freq2 = 0;
            for (int i = 0; i < A.Count; i++)
            {
                if (A[i] == majEle1) freq1++;
                if (A[i] == majEle2) freq2++;
            }

            if (freq1 > A.Count / 3)
                return majEle1;
            else if (freq2 > A.Count / 3)
                return majEle2;
            else return -1;
        }

        
